export function toggledReducer(state = {}, action) {
    switch (action.type) {
        case "Toggled":
            return {
                ...state,
                edit: action.payload
            };
        default:
            return state;
    }
}
export function ViewFaculty(state = {}, action) {
    switch (action.type) {
        case "View_Faculty":
            return {
                ...state,
                view: action.payload
            };
        default:
            return state;
    }
}
